Sometimes, a C library wants to provide a pointer to something, but not let you know the internal details of the thing it wants. The simplest way is to use a void * argument: void foo(void *arg);
void bar(void *arg); We can represent this in Rust with the c_void type: extern crate libc; extern "C" { pub fn foo(arg: *mut libc::c_void); pub fn bar(arg: *mut libc::c_void);
}
# fn main() {} This is a perfectly valid way of handling the situation. However, we can do a bit better. To solve this, some C libraries will instead create a struct, where the details and memory layout of the struct are private. This gives some amount of type safety. These structures are called â€˜opaqueâ€™. Hereâ€™s an example, in C: struct Foo; /* Foo is a structure, but its contents are not part of the public interface */
struct Bar;
void foo(struct Foo *arg);
void bar(struct Bar *arg); To do this in Rust, letâ€™s create our own opaque types: #[repr(C)] pub struct Foo { _private: [u8; 0] }
#[repr(C)] pub struct Bar { _private: [u8; 0] } extern "C" { pub fn foo(arg: *mut Foo); pub fn bar(arg: *mut Bar);
}
# fn main() {} By including a private field and no constructor, we create an opaque type that we can't instantiate outside of this module. (A struct with no field could be instantiated by anyone.) We also want to use this type in FFI, so we have to add #[repr(C)]. And to avoid warning around using () in FFI, we instead use an empty array, which works just as well as an empty type but is FFI-compatible. But because our Foo and Bar types are different, weâ€™ll get type safety between the two of them, so we cannot accidentally pass a pointer to Foo to bar(). Notice that it is a really bad idea to use an empty enum as FFI type. The compiler relies on empty enums being uninhabited, so handling values of type &Empty is a huge footgun and can lead to buggy program behavior (by triggering undefined behavior).

