The lifetime (sometimes called a borrow ) is alive from the place it is created to its last use. The borrowed thing needs to outlive only borrows that are alive. This looks simple, but there are few subtleties. The following snippet compiles, because after printing x, it is no longer needed, so it doesn't matter if it is dangling or aliased (even though the variable x technically exists to the very end of the scope). let mut data = vec![1, 2, 3];
let x = &data[0];
println!("{}", x);
// This is OK, x is no longer needed
data.push(4); However, if the value has a destructor, the destructor is run at the end of the scope. And running the destructor is considered a use â€’ obviously the last one. So, this will not compile. #[derive(Debug)]
struct X<'a>(&'a i32); impl Drop for X<'_> { fn drop(&mut self) {}
} let mut data = vec![1, 2, 3];
let x = X(&data[0]);
println!("{:?}", x);
data.push(4);
// Here, the destructor is run and therefore this'll fail to compile. Furthermore, there might be multiple possible last uses of the borrow, for example in each branch of a condition. # fn some_condition() -> bool { true }
let mut data = vec![1, 2, 3];
let x = &data[0]; if some_condition() { println!("{}", x); // This is the last use of `x` in this branch data.push(4); // So we can push here
} else { // There's no use of `x` in here, so effectively the last use is the // creation of x at the top of the example. data.push(5);
} And a lifetime can have a pause in it. Or you might look at it as two distinct borrows just being tied to the same local variable. This often happens around loops (writing a new value of a variable at the end of the loop and using it for the last time at the top of the next iteration). let mut data = vec![1, 2, 3];
// This mut allows us to change where the reference points to
let mut x = &data[0]; println!("{}", x); // Last use of this borrow
data.push(4);
x = &data[3]; // We start a new borrow here
println!("{}", x); Historically, Rust kept the borrow alive until the end of scope, so these examples might fail to compile with older compilers. Also, there are still some corner cases where Rust fails to properly shorten the live part of the borrow and fails to compile even when it looks like it should. These'll be solved over time.

