Some external libraries require the usage of callbacks to report back their current state or intermediate data to the caller. It is possible to pass functions defined in Rust to an external library. The requirement for this is that the callback function is marked as extern with the correct calling convention to make it callable from C code. The callback function can then be sent through a registration call to the C library and afterwards be invoked from there. A basic example is: Rust code: extern fn callback(a: i32) { println!("I'm called from C with value {0}", a);
} #[link(name = "extlib")]
extern { fn register_callback(cb: extern fn(i32)) -> i32; fn trigger_callback();
} fn main() { unsafe { register_callback(callback); trigger_callback(); // Triggers the callback. }
} C code: typedef void (*rust_callback)(int32_t);
rust_callback cb; int32_t register_callback(rust_callback callback) { cb = callback; return 1;
} void trigger_callback() { cb(7); // Will call callback(7) in Rust.
} In this example Rust's main() will call trigger_callback() in C, which would, in turn, call back to callback() in Rust.

