Foreign APIs often export a global variable which could do something like track global state. In order to access these variables, you declare them in extern blocks with the static keyword: extern crate libc; #[link(name = "readline")]
extern { static rl_readline_version: libc::c_int;
} fn main() { println!("You have readline version {} installed.", unsafe { rl_readline_version as i32 });
} Alternatively, you may need to alter global state provided by a foreign interface. To do this, statics can be declared with mut so we can mutate them. extern crate libc; use std::ffi::CString;
use std::ptr; #[link(name = "readline")]
extern { static mut rl_prompt: *const libc::c_char;
} fn main() { let prompt = CString::new("[my-awesome-shell] $").unwrap(); unsafe { rl_prompt = prompt.as_ptr(); println!("{:?}", rl_prompt); rl_prompt = ptr::null(); }
} Note that all interaction with a static mut is unsafe, both reading and writing. Dealing with global mutable state requires a great deal of care.

